//There are  two modes.   First, create the  new segments  and "Split"
//symbols  to  their  immediate  right  context.   Then  allocate  the
//photosynthesis by  elongating and shortening the  new segments. When
//the new  segments are of right  size, in the second  mode will split
//the segments (according to some function) to put the right number of
//leaves into right positions in the new growth.

//New segments: If there is a  segment in the left context, expand. If
//not, some split symbol is there instead to denote split mode
   void _P1(double s,double od,PoplarBudData d)
{  
  PoplarBudData dead(DEAD, 0.0, GetValue(d, LGAomega), 1.0);
  PoplarBudData dorm(DORMANT, 0.1, GetValue(d, LGAomega)+1, 1.0);
  PoplarBudData d1(GetValue(d, LGAstate), 0.1, GetValue(d, LGAomega), 1.0);

  LGMdouble o=GetValue(d, LGAomega);
  LGMdouble st = GetValue(d, LGAstate);

  //Bend branches upwards 0<=asin(direct.getZ()) &&

  PositionVector direct = GetDirection(d);
  direct.normalize();
  double fac = 0.0;
  if(asin(direct.getZ())<maxIncl)
  {
    PositionVector up(0.0, 0.0, 1.0);
    PositionVector cr = Cross(up, direct);
    fac = cr.length();
    fac *= bendUp;
    if (o>1)
       fac *= 5.0;
    //fac = abs(fac);
  }

 if (GetValue(d, LGAstate)==DEAD)
      { Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dead));Produce((ModuleIdType)(B_id));}
 else if (GetValue(d, LGAstate)==DORMANT)
      { Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dorm));Produce((ModuleIdType)(B_id));}
 else if (GetValue(d, LGAomega)==0.0){
    { Produce((ModuleIdType)(F_id));Produce((double)(0.3));Produce((double)( o));Produce((ModuleIdType)(F_id)); Produce((ModuleIdType)(Split_id)); Produce((ModuleIdType)(SB_id)); Produce((ModuleIdType)(Roll_id));Produce((double)(RollAngle(u)));Produce((ModuleIdType)(Roll_id)); Produce((ModuleIdType)(Pitch_id));Produce((double)(TurnAngle(u)));Produce((ModuleIdType)(Pitch_id)); Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dorm));Produce((ModuleIdType)(B_id)); Produce((ModuleIdType)(EB_id));  Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(d1));Produce((ModuleIdType)(B_id));}
 }
 else if (GetValue(d,LGAomega) == 1.0){
         double sign = Sign(u);
         double angle = TurnAngle(u);
         { Produce((ModuleIdType)(F_id));Produce((double)(0.3));Produce((double)( o));Produce((ModuleIdType)(F_id)); Produce((ModuleIdType)(Split_id)); Produce((ModuleIdType)(SB_id)); Produce((ModuleIdType)(Turn_id));Produce((double)(sign*angle));Produce((ModuleIdType)(Turn_id)); Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dorm));Produce((ModuleIdType)(B_id)); Produce((ModuleIdType)(EB_id));  Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(d1));Produce((ModuleIdType)(B_id));}
 }
 else if (GetValue(d,LGAomega) == 2.0){
         double sign = Sign(u);
         double angle = TurnAngle(u);
         { Produce((ModuleIdType)(F_id));Produce((double)(0.3));Produce((double)( o));Produce((ModuleIdType)(F_id)); Produce((ModuleIdType)(Split_id));  Produce((ModuleIdType)(SB_id)); Produce((ModuleIdType)(Turn_id));Produce((double)(sign*angle));Produce((ModuleIdType)(Turn_id)); Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dorm));Produce((ModuleIdType)(B_id)); Produce((ModuleIdType)(EB_id)); Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(d1));Produce((ModuleIdType)(B_id));}
 }
 else
    { Produce((ModuleIdType)(B_id));Produce((PoplarBudData)(dead));Produce((ModuleIdType)(B_id));}
}

